import './App.css';
import Records from './components/Records';
import AddUser from './components/AddUser';

import { BrowserRouter,Routes,Route,Router, createBrowserRouter ,RouteProvider} from 'react-router-dom';

function App() {
  const router = createBrowserRouter([
    {
      path:"/",
      element:(<AddUser/>
      ),
    },
    {  
      path:"/getUsers",
      element:(<Records/>),
    },

  ]);



  return (
    <BrowserRouter>

     <Routes>
                <Route exact path='/getUsers' element={< Records/>}></Route>
                <Route exact path='/' element={< AddUser />}></Route>

        </Routes>



    </BrowserRouter>

  );
}

export default App;
